import FilterItem from './filteritem/FilterItem';


const SearchUl = styled.ul`
    background: cyan;
    position: absolute;
    top: 35px;
    width: 100%;
    max-width: 800px;
    margin: 15px auto;
    padding: 10px;
    z-index:5;
`;

const FilterSearch = ({filtered}) => {
    const RenderFilteredSearch = () => {

        filtered.forEach(item => {
            console.log();
        });
    }

    return(
        <SearchUl>
            <FilterItem itemName={"hi"}/>
            <FilterItem itemName={"bye"}/>
            <FilterItem itemName={"cya"}/>
            <FilterItem itemName={"lol"}/>
        </SearchUl>
    )
}

export default FilterSearch;
